import React from 'react';

import { Grid } from '@material-ui/core';

import Drawer from '../../components/Navigation/Drawer';
import Jumbotron from '../../components/Landing/Jumbotron';


const Landing = () => {

    return (
        <Grid container>

            <Drawer />

            <Jumbotron />

        </Grid>
    );
};

export default Landing;
